  [],\n\t\"revision_timestamp\": \"2015-05-07T06:04:37.465271\",\n\t\"name\": \"development-of-modular-spray-cooled-assemblies-for-high-heat-fluxes-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This NASA SBIR project will develop modular
  spray-cooled assemblies that satisfy NASA power and mass budgets and can be scaled
  to cool multiple heat sources subjected to high heat fluxes and microgravity conditions.
  \ Much of the work on spray cooling has been experimental in nature and technological
  improvements have been the result of extensive experimental work.  There is a need
  for a better theoretical understanding.  Power Electronics Leveling Solutions L.L.C.
  (PELS) analytical team has formulated mathematically the conditions for extracting
  high heat fluxes from a heated surface in addition to the latent heat of vaporization
  that takes place in the formation of the bubble under phase change.  PELS has now
  the opportunity of combining its analytical and experimental capabilities to develop
  modular assemblies based on spray cooling with the goal of achieving heat fluxes
  in excess of 100 W/cm2 while satisfying power and mass budgets.\",\n\t\"license_title\":
